import React from "react";
import "./search.box.style.css";

export const SearchBox = (props) => {
  return (
    <div className="search">
      <input
        type="search"
        placeholder="search monster"
        onChange={(props) => this.setState({ searchField: props.target.value })}
      />
    </div>
  );
};
